import React, { useState } from 'react';
import Task from './Task';
import './taskList.css';

const TaskList = () => {
  const [tasks, setTasks] = useState([
    { id: 1, title: 'test 1', description: 'test 1 demo', status: 'incompleted' },
    { id: 2, title: 'The Best Coding Channel', description: 'I have to create my channel...', status: 'completed' },
    { id: 3, title: 'CPP concepts', description: 'I need to clear basics of Cpp...', status: 'incompleted' },
  ]);

  return (
    <div className="task-list">
      {tasks.map(task => (
        <Task key={task.id} task={task} />
      ))}
      <div className="add-task">
        <button>Add Task</button>
      </div>
    </div>
  );
};

export default TaskList;
